import { Card , CardSection , Button ,Input } from './common';

class EmployeeCreate extends Component{
	render(){
		return(
			<Card>
				<CardSection>
					<Input label="Name"
						placeholder="name"
					/>
				</CardSection>

				<CardSection>
					<Input label="Phone No."
						placeholder="+91**********"
					/>
				</CardSection>

				<CardSection>
				</CardSection>

				<CardSection>
					<Button>
						Add
					</Button>
				</CardSection>
			</Card>
		)
	}
}

export default EmployeeCreate;
